import React from 'react'

function Why(props) {
  return (
      
        
      
     
           <div className='row1'>
             <div className='column1' >
                 <div className='km'><img src={props.img}></img></div>
                   <h3>{props.name}</h3>
                 </div>
  
            </div>
  
  )
}

export default Why
